// src/pages/Home.js

import React, { useRef, useEffect } from 'react';
import { motion, useScroll, useTransform } from 'framer-motion';
import { Link } from 'react-router-dom';
import { homeData } from '../data';
import TestimonialSlideshow from '../components/TestimonialSlideshow';
import '../styles/Home.css';

const Home = () => {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  const heroRef = useRef(null);
  const galleryRef = useRef(null);

  // Parallax for Hero section
  const { scrollYProgress: heroScrollYProgress } = useScroll({
    target: heroRef,
    offset: ['start end', 'end start'], // Trigger when hero top hits viewport bottom
  });
  const heroBgY = useTransform(heroScrollYProgress, [0, 1], ['-20%', '20%']);

  // Parallax for Gallery section
  const { scrollYProgress: galleryScrollYProgress } = useScroll({
    target: galleryRef,
    offset: ['start end', 'end start'],
  });
  const galleryBgY = useTransform(galleryScrollYProgress, [0, 1], ['-20%', '20%']);

  return (
    <div className="home-page-clone">

      {/* Section 1: Services (as per your screenshot) */}
      <section className="services-section">
        <div className="services-text-column">
          <div className="services-content">
            <h2>{homeData.services.title}</h2>
            {/* A floral SVG similar to the screenshot */}
            <svg className="services-icon" viewBox="0 0 100 20">
                <path d="M0 10 Q 25 20, 50 10 T 100 10" stroke="#b56576" strokeWidth="2" fill="none" />
                <circle cx="50" cy="2" r="2" fill="#b56576" />
            </svg>
            <p>{homeData.services.subtitle}</p>
            <Link to={homeData.services.buttonLink} className="discover-button">{homeData.services.buttonText}</Link>
          </div>
        </div>
        <div className="services-image-column" style={{ backgroundImage: `url(${homeData.services.image})` }}></div>
      </section>

      {/* Section 2: Full-Screen Parallax Hero */}
      <section ref={heroRef} className="hero-section">
        <div className="hero-content">
          <h1 className="hero-title">
            {homeData.hero.titleLines.map((line, index) => (
              <span key={index}>{line}</span>
            ))}
          </h1>
          <a href="#testimonials" className="hero-scroll-arrow" aria-label="Scroll to testimonials">
             <svg preserveAspectRatio="xMidYMid meet" viewBox="45.87 4.75 111.491 192.633">
                <path d="M156.124 46.421L103.09 5.431a3.245 3.245 0 0 0-4.003.019L47.109 46.44a3.252 3.252 0 0 0-.54 4.568c1.112 1.411 3.233 1.655 4.644.54L98 14.711V194.13c0 1.798 1.202 3.253 3 3.253s3-1.455 3-3.253V14.63l47.969 36.937c.591.457 1.379.68 2.077.68.972 0 1.976-.435 2.618-1.264 1.1-1.42.883-3.463-.54-4.562z"></path>
             </svg>
          </a>
        </div>
        <div className="hero-pattern-overlay"></div>
        <motion.div className="parallax-background" style={{ y: heroBgY, backgroundImage: `url(${homeData.hero.image})` }} />
      </section>

      {/* Anchor for scrolling */}
      <div id="testimonials" style={{position: 'relative', top: '-80px'}}></div>

      {/* Section 3: Testimonials */}
      <section className="testimonials-section">
        <TestimonialSlideshow testimonials={homeData.testimonials} />
      </section>

      {/* Section 4: Gallery CTA */}
      <section ref={galleryRef} className="gallery-cta-section">
          <div className="gallery-cta-content">
              <h2>{homeData.gallery.title}</h2>
              <p>{homeData.gallery.subtitle}</p>
              <Link to={homeData.gallery.buttonLink} className="discover-button-dark">{homeData.gallery.buttonText}</Link>
          </div>
          <div className="gallery-cta-overlay"></div>
          <motion.div className="parallax-background" style={{ y: galleryBgY, backgroundImage: `url(${homeData.gallery.image})` }} />
      </section>

    </div>
  );
};

export default Home;
